<?php

$html = scraperWiki::scrape("http://www.trailjournals.com/location.cfm?trailname=13160");
//print $html . "\n";

require 'scraperwiki/simple_html_dom.php';           
$dom = new simple_html_dom();
$dom->load($html);

foreach($dom->find("a.link") as $link){
    $url = "http://www.trailjournals.com/" . $link->href;
    $dbcheck = scraperwiki::select("url from swdata where url='" . $url . "'");
    
    if (count($dbcheck)==1) {
        continue;
    }

    $postDom = new simple_html_dom();
    $postDom->load(scraperWiki::scrape($url));
    $postDate = $postDom->find("i");
    $postData = $postDom->find("span.teal");
    //if (count($postData)==0) $postData = array(0=>'',1=>'',2=>'',3=>'');

    $lat = 0;
    $lng = 0;
    preg_match('/\d+/', $postData[0]->plaintext, $matches);
    if (count($matches)>0) {
        $milemarker = intval($matches[0]);
        //print $milemarker." ";
        $coordCheck = scraperwiki::select("* from milemarkers where mile=" . $milemarker );
        $lat = $coordCheck[0]['lat'];
        $lng = $coordCheck[0]['lng'];
    }

    $record = array(
        'title'       => $link->plaintext, 
        'url'         => $url,
        'date'        => $postDate[0]->plaintext,
        'latitude'    => $lat,
        'longitude'   => $lng,
        'destination' => $postData[0]->plaintext,
        'start'       => $postData[1]->plaintext,
        'miles_today' => intval($postData[2]->plaintext),
        'miles_total' => intval($postData[3]->plaintext)
    );
    scraperwiki::save(array('url'), $record);
}

